import QRCode from "./components/QRCode";
import imgSrc from "./images/image.png";
function App() {
  console.log();
  return (
    <div className="App">
      <img style={{ width: 200, height: 200 }} alt="" src={imgSrc} />
      <QRCode />
    </div>
  );
}

export default App;
